import React from "react";
import {renderPhrase} from "./utilites"

const MainTitle = ({ length }) => {
    return (
        <h2>
            <span
                className={"badge " + (length > 0 ? "bg-primary" : "bg-danger")}
            >
                {length + " " + renderPhrase(length)} с тобой сегодня
            </span>
        </h2>
    );
};

export default MainTitle;
